&quot;Galapagos is one of the wonder places of the world,
a laboratory of evolution. Because of  Darwin it is
always a historic place  for  any zoologist. Anyone
interested in the history of life on  Earth and how
it came to be really has to come here.&quot; 

- David Attenborough

In this  stunning series, David Attenborough  peels 
back the Earth's surfaceto shed light on the hidden
forces that have built and shaped  one of  its most 
amazing places: the islands of the Galapagos.  This 
landmark three-part documentary introduces us  to a 
range of extraordinary creatures -  from the iconic
Giant Tortois to the  courting Waved  Albatrosses -
while the use  of 3D  technology  allows us to  see 
all this as if we are  actually there.  The  result 
is a truly mesmerising  exploration of the  world's 
most  miraculous landscape,  plant life and animals.


